fn safe_divide(x: i64, y: i64) -> Result<i64, Box<EvalAltResult>> { if y == 0 { // Return an error if y is zero Err("Division by zero!".into()) // shortcut to create Box<EvalAltResult::ErrorRuntime> } else { Ok(x / y) }
} let mut engine = Engine::new(); engine.register_fn("divide", safe_divide); if let Err(error) = engine.eval::<i64>("divide(40, 0)") { println!("Error: {error:?}"); // prints ErrorRuntime("Division by zero detected!", (1, 1)")
} Tip: Create a Box<EvalAltResult> Box<EvalAltResult> implements From<&str> and From<String> etc. and the error text gets converted into Box<EvalAltResult::ErrorRuntime>. The error values are Box-ed in order to reduce memory footprint of the error path, which should be hit rarely.

