Any parameter in a registered Rust function with a specific type has higher precedence over Dynamic , so it is important to understand which version of a function will be used. Parameter matching starts from the left to the right. Candidate functions will be matched in order of parameter types. Therefore, always leave Dynamic parameters (up to 16, see below) as far to the right as possible. use rhai::{Engine, Dynamic}; // Different versions of the same function 'foo'
// will be matched in the following order. fn foo1(x: i64, y: &str, z: bool) { } fn foo2(x: i64, y: &str, z: Dynamic) { } fn foo3(x: i64, y: Dynamic, z: bool) { } fn foo4(x: i64, y: Dynamic, z: Dynamic) { } fn foo5(x: Dynamic, y: &str, z: bool) { } fn foo6(x: Dynamic, y: &str, z: Dynamic) { } fn foo7(x: Dynamic, y: Dynamic, z: bool) { } fn foo8(x: Dynamic, y: Dynamic, z: Dynamic) { } let mut engine = Engine::new(); // Register all functions under the same name (order does not matter) engine.register_fn("foo", foo5) .register_fn("foo", foo7) .register_fn("foo", foo2) .register_fn("foo", foo8) .register_fn("foo", foo1) .register_fn("foo", foo3) .register_fn("foo", foo6) .register_fn("foo", foo4); Only the right-most 16 parameters can be Dynamic The number of parameter permutations goes up exponentially, and therefore there is a realistic limit of 16 parameters allowed to be Dynamic , counting from the right-most side . For example, Rhai will not find the following function  Oh! and those 16 parameters to the right certainly have nothing to do with it! // The 'd' parameter counts 17th from the right!
