Any similarly-named function defined in a script overrides any built-in or registered native Rust function of the same name and number of parameters. // Override the built-in function 'to_float' when called as a method
fn to_float() { print(`Ha! Gotcha! ${this}`); 42.0
} let x = 123.to_float(); print(x); // what happens? Tip: Monkey patching Rhai Most of Rhai's built-in functionality resides in registered functions. If you dislike any built-in function, simply provide your own implementation to override the built-in version. The ability to modify the operating environment dynamically at runtime is called " monkey patching ." It is rarely recommended, but if you need it, you need it bad. In other words, do it only when all else fails . Do not monkey patch Rhai simply because you can . Search order for functions Rhai searches for the correct implementation of a function in the following order: Rhai script-defined functions , Native Rust functions registered directly via the Engine::register_XXX API, Native Rust functions in packages that have been loaded via Engine::register_global_module, Native Rust or Rhai script-defined functions in imported modules that are exposed to the global namespace (e.g. via the #[rhai_fn(global)] attribute in a plugin module ), Native Rust or Rhai script-defined functions in modules loaded via Engine::register_static_module that are exposed to the global namespace (e.g. via the #[rhai_fn(global)] attribute in a plugin module ), Built-in functions.

