let ast = engine.compile(script)?; // Create a custom 'Scope'
let mut scope = Scope::new(); // A custom 'Scope' can also contain any variables/constants available to
// the functions
scope.push("my_var", 42_i64);
scope.push("my_string", "hello, world!");
scope.push_constant("MY_CONST", true); // Evaluate a function defined in the script, passing arguments into the
// script as a tuple.
//
// Beware, arguments must be of the correct types because Rhai does not
// have built-in type conversions. If arguments of the wrong types are passed,
// the Engine will not find the function.
//
// Variables/constants pushed into the custom 'Scope'
// (i.e. 'my_var', 'my_string', 'MY_CONST') are visible to the function. let result = engine.call_fn::<i64>(&mut scope, &ast, "hello", ( "abc", 123_i64 ) )?;
// ^^^ ^^^^^^^^^^^^^^^^^^
// return type must be specified put arguments in a tuple let result = engine.call_fn::<i64>(&mut scope, &ast, "hello", ( 123_i64, ) )?;
// ^^^^^^^^^^^^ tuple of one let result = engine.call_fn::<i64>(&mut scope, &ast, "hello", () )?;
// ^^ unit = tuple of zero Warning: Functions with one parameter Functions with only one single parameter is easy to get wrong. The proper Rust syntax is a tuple with one item : ( arg , ) Notice the comma (,) after the argument. Without it, the expression is a single value (arg) which is the same as arg and not a tuple. A syntax error with very confusing error message will be generated by the Rust compiler if the comma is omitted. Default behavior When using Engine::call_fn, the AST is always evaluated before the function is called. This is usually desirable in order to import the necessary external modules that are needed by the function . All new variables / constants introduced are, by default, not retained inside the Scope . In other words, the Scope is rewound before each call. If these default behaviors are not desirable, override them with Engine::call_fn_with_options.

