By default, the Engine rewinds the custom Scope after each call to the initial size, so any new variable / constant defined are cleared and will not spill into the custom Scope . This prevents the Scope from being continuously polluted by new variables and is usually the intuitively expected behavior. Setting rewind_scope to false retains new variables / constants within the custom Scope . This allows the function to easily pass values back to the caller by leaving them inside the custom Scope . Warning: new variables persist in Scope If the Scope is not rewound, beware that all variables / constants defined at top level of the function or in the script body will persist inside the custom Scope . If any of them are temporary and not intended to be retained, define them inside a statements block (see example below). 
 Rhai script 
 fn initialize() { let x = 42; // 'x' is retained let y = x * 2; // 'y' is retained // Use a new statements block to define temp variables { let temp = x + y; // 'temp' is NOT retained foo = temp * temp; // 'foo' is visible in the scope }
} let foo = 123; // 'foo' is retained // Use a new statements block to define temp variables
{ let bar = foo / 2; // 'bar' is NOT retained foo = bar * bar;
} 
