Trivia This is exactly how Rhai's built-in packages , such as BasicMathPackage, are actually implemented. By far the easiest way to create a custom package is to call plugin::combine_with_exported_module! from within def_package! which simply merges in all the functions defined within a plugin module . Due to specific requirements of a package , plugin::combine_with_exported_module! flattens all sub-modules (i.e. all functions and type iterators defined within sub-modules are pulled up to the top level instead) and so there will not be any sub-modules added to the package . Variables in the plugin module are ignored. // Import necessary types and traits.
use rhai::def_package;
use rhai::packages::{ ArithmeticPackage, BasicArrayPackage, BasicMapPackage, LogicPackage
};
use rhai::plugin::*; // Define plugin module.
#[export_module]
mod my_plugin_module { // Custom type. pub type ABC = TestStruct; // Public constant. pub const MY_NUMBER: i64 = 42; // Public function. pub fn greet(name: &str) -> String { format!("hello, {}!", name) } // Non-public functions are by default not exported. fn get_private_num() -> i64 { 42 } // Public function. pub fn get_num() -> i64 { get_private_num() } // Custom operator. #[rhai_fn(name = "@")] pub fn square_add(x: i64, y: i64) -> i64 { x * x + y * y } // A sub-module. If using 'combine_with_exported_module!', however, // it will be flattened and all functions registered at the top level. // // Because of this flattening, sub-modules are very convenient for // putting feature gates onto large groups of functions. #[cfg(feature = "sub-num-feature")] pub mod my_sub_module { // Only available under 'sub-num-feature'. pub fn get_sub_num() -> i64 { 0 } }
} def_package! { /// My own personal super package pub MyPackage(module) : ArithmeticPackage, LogicPackage, BasicArrayPackage, BasicMapPackage { // Merge all registered functions and constants from the plugin module // into the custom package. // // The sub-module 'my_sub_module' is flattened and its functions // registered at the top level. // // The text string name in the second parameter can be anything // and is reserved for future use; it is recommended to be an // ID string that uniquely identifies the plugin module. // // The constant variable, 'MY_NUMBER', is ignored. // // This call ends up registering three functions at the top level of // the package: // 1) 'greet' // 2) 'get_num' // 3) 'get_sub_num' (flattened from 'my_sub_module') // combine_with_exported_module!(module, "my-mod", my_plugin_module)); } |> |engine| { // This optional block is used to set up an 'Engine' during registration. // Define a custom operator '@' with precedence of 160 // (i.e. between +|- and *|/). engine.register_custom_operator("@", 160).unwrap(); }
}

