Use Dynamic::read_lock and Dynamic::write_lock to get an immutable/mutable reference to the data inside a Dynamic . struct TheGreatQuestion { answer: i64
} let question = TheGreatQuestion { answer: 42 }; let mut value: Dynamic = Dynamic::from(question); let q_ref: &TheGreatQuestion = &*value.read_lock::<TheGreatQuestion>().unwrap();
// ^^^^^^^^^^^^^^^^^^^^ cast to data type println!("answer = {}", q_ref.answer); // prints 42 let q_mut: &mut TheGreatQuestion = &mut *value.write_lock::<TheGreatQuestion>().unwrap();
// ^^^^^^^^^^^^^^^^^^^^ cast to data type q_mut.answer = 0; // mutate value let value = value.cast::<TheGreatQuestion>(); println!("new answer = {}", value.answer); // prints 0 TL;DR  Why read_lock and write_lock? As the naming shows, something is locked in order to allow accessing the data within a Dynamic , and that something is a shared value created by capturing variables from closures . Shared values are implemented as Rc<RefCell<Dynamic>> (Arc<RwLock<Dynamic>> under sync ). If the value is not a shared value, or if running under no_closure where there is no capturing, this API de-sugars to a simple reference cast. In other words, there is no locking and reference counting overhead for the vast majority of non-shared values. If the value is a shared value, then it is first locked and the returned lock guard allows access to the underlying value in the specified type.

