By default, Rhai looks up access to variables from the enclosing block scope, working its way outwards until it reaches the top (global) level, then it searches the Scope that is passed into the Engine::eval call. There is a built-in facility for advanced users to hook into the variable resolution service and to override its default behavior. To do so, provide a closure to the Engine via Engine::on_var. let mut engine = Engine::new(); // Register a variable resolver.
