}); Benefits of using a variable resolver Avoid having to maintain a custom Scope with all variables regardless of need (because a script may not use them all). Short-circuit variable access, essentially overriding standard behavior. Lazy-load variables when they are accessed, not up-front. This benefits when the number of variables is very large, when they are timing-dependent, or when they are expensive to load. Rename system variables on a script-by-script basis without having to construct different Scope 's. Returned values are constants Variable values returned by a variable resolver are treated as constants . This is to avoid needing a mutable reference to the underlying data provider which may not be possible to obtain. To change these variables , better push them into a custom Scope instead of using a variable resolver. Tip: Returning shared values It is possible to return a shared value from a variable resolver. This is one way to implement Mutable Global State .

