} Prevent data races Data races are possible in Rhai scripts. Avoid performing a method call on a captured shared variable (which essentially takes a mutable reference to the shared object) while using that same variable as a parameter in the method call  this is a sure-fire way to generate a data race error. If a shared value is used as the this pointer in a method call to a closure function, then the same shared value must not be captured inside that function, or a data race will occur and the script will terminate with an error. let x = 20; x.is_shared() == false; // 'x' not shared, so no data races let f = |a| this += x + a; // 'x' is captured in this closure x.is_shared() == true; // now 'x' is shared x.call(f, 2); // <- error: data race detected on 'x'

